return {
    OnSave: function (form, gridview) {
        var detailFee = gridview.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        if (detailFee && detailFee.AllListViewItem.length > 0) {
            detailFee.AllListViewItem.filter(x => !x.GroupRow).forEach((item, index) => {
                item.Entity.Order = index;
            });
        }
    },
    CheckSave: function () {
        var detailFee = this.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        var data = detailFee.AllListViewItem.filter(x => !x.GroupRow);
        const seen = new Set();
        const duplicates = data.filter(item => {
            const key = `${item.Entity.DescriptionId}-${item.Entity.VendorId}-${item.Entity.UnitId}`;
            if (seen.has(key)) {
                return true;
            } else {
                seen.add(key);
                return false;
            }
        });
        if (duplicates.length > 0) {
            this.EditForm.OpenConfig("Duplicate fees have been detected. Please double-check and confirm if the data is correct. Data has been saved ! !", () => {
            }, () => { }, false, [], true);
            detailFee.ClearSelected();
            duplicates.forEach(x => {
                x.Selected = true;
                x.Element.focus();
            })
            return false;
        }
        return false;
    },
    SaveAs: async function (btn) {
        var newEntity = JSON.parse(JSON.stringify(this.Entity));
        this.Entity = newEntity;
        this.Entity.Id = this.Uuid7.NewGuid();
        this.Entity.BookingNo = null;
        this.Entity.ShipmentId = null;
        this.Entity.HblNo = null;
        this.Entity.BookingNoteId = null;
        this.Entity.BookingOrderId = null;
        this.Entity.IsSend = false;
        this.Entity.FileNo = null;
        this.Entity.MblNo = null;
        this.Entity.ReferenceNo = null;
        this.Entity.ReceiverIds = null;
        this.Entity.CreatedOn = this.dayjs();
        this.Entity.BookingDate = this.dayjs();
        var config = JSON.parse(localStorage.getItem("SalesFunction"));
        this.Entity.StatusId = config["APPROVE_BOOKINGLOCAL"] ? 3 : 1;
        this.Entity.InsertedBy = this.Token.UserId;
        this.Entity.NoApproved = config["APPROVE_BOOKINGLOCAL"] ? true : false;
        var inquiryDetail = this.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        if (inquiryDetail && inquiryDetail.AllListViewItem.length > 0) {
            inquiryDetail.AllListViewItem.forEach(row => {
                row.Entity.Id = this.Uuid7.NewGuid();
                row.Entity.BookingId = this.Entity.Id;
                row.Entity.StatusId = 1;
                row.Entity.NoApproved = config["APPROVE_BOOKINGLOCAL"] ? true : false;
                row.Children.forEach(cell => {
                    cell.Entity = row.Entity;
                });
                row.UpdateView(true);
            });
        }
        this.UpdateView(true);
        this.Dirty = true;
        this.Toast.Success("Save as success");
    },
    ReloadSummary: function () {
        window.setTimeout(() => {
            var detail = this.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "Summary");
            detail.ReloadData();
        }, 500);
    },
    UpdateGroupFee: function (data) {
        data.Parent.Entity.GroupFee = data.Entity.Description.Group ? data.Entity.Description.Group.Name : 'Local charge';
        data.Parent.UpdateView(false, false, "GroupFee");
    },
    ChangeContainer: function (dropdown) {
        this.UpdateView(true, false, "Cont20Id", "Cont40Id", "Cont45Id", "Cont40HCId");
    },
    BeforeCreated: function (entity) {
        entity.GroupFee = entity.GroupFee;
        var detail = this.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        if (detail && detail.AllListViewItem && detail.AllListViewItem.length == 0) {
            return;
        }
        var lastItem = detail.AllListViewItem[detail.AllListViewItem.length - 1];
        entity.VendorId = entity.VendorId == null ? lastItem.Entity.VendorId || null : entity.VendorId;
    },
    CalcPrice: function (com, entity) {
        entity.Quantity = this.Decimal(entity.Quantity || 0);
        entity.Amount = this.Decimal(entity.Amount || 0);
        entity.TotalAmount = (entity.Quantity || new this.Decimal(0)).times(entity.Amount || new this.Decimal(0));
        entity.AmountTax = (entity.TotalAmount).times(entity.Vat || new this.Decimal(0)).div(100);
        entity.TotalAmountTax = entity.TotalAmount.plus(entity.AmountTax);
        com.Parent.UpdateView(false);
    },
    CheckCurrency: function (com, entity) {
        com.Parent.UpdateView(false);
    },
    OnSaveAdd: function (form, gridview) {
        this.Entity = {
            Id: this.Uuid7.NewGuid(),
            BookingNo: null,
            StatusId: 1
        }
    },
    AddDuplicateMenu: function (form, gridview) {
        gridview.MenuItems.push({
            Icon: "fal fa-folders",
            Text: "Duplicate",
            Click: () => this.DuplicateFee(form, gridview)
        });
    },
    DuplicateFee: function (form, gridview) {
        var defaultFee = form.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "BookingDetail");
        var newItem = JSON.parse(JSON.stringify(defaultFee.Header.filter(x => x.FieldName == "VendorId" || x.FieldName == "IsBuying")));
        newItem.forEach(item => {
            item.FieldName = "View" + item.FieldName;
        })
        var form = this.EditForm.OpenConfig("Select vendor!", () => {
            if (!form.Entity.ViewVendorId) {
                return;
            }
            var selecteds = defaultFee.AllListViewItem.filter(x => !x.GroupRow && x.Selected);
            var newFees = JSON.parse(JSON.stringify(selecteds.map(x => x.Entity)));
            newFees.forEach(item => {
                item.Id = this.Uuid7.NewGuid();
                item.VendorId = form.Entity.ViewVendorId;
                if (!item.IsObh) {
                    item.Amount = null;
                    item.TotalAmount = null;
                    item.AmountTax = null;
                    item.TotalAmountTax = null;
                }
                item.IsBuying = this.EditForm.Entity.ViewIsBuying;
            });
            defaultFee.LoadMasterData(newFees).then(() => {
                defaultFee.ClearSelected();
                defaultFee.AddRows(newFees).then(rows => {
                    rows.forEach(row => {
                        row.Selected = true;
                    });
                    rows[0].Element.focus();
                    var detail = form.EditForm.ChildCom.find(x => x.IsListView && x.Meta.FieldName == "Summary");
                    detail.ReloadData();
                });
            });
        }, () => { }, true, newItem);
    }
}

